import { useState, useEffect } from "react";
import { GoogleMap, Marker, InfoWindow, loadScript } from "@react-google-maps/api";
import Axios from "axios";
import Header from "./Header";
import Footer from "./Footer";

const mapContainerStyle = {
  height: "400px",
  width: "100%",
};

const center = {
  lat: 0,
  lng: 0,
};

export default function App() {
  const [restaurants, setRestaurants] = useState([]);
  const [selectedCity, setSelectedCity] = useState("");
  const [selectedZone, setSelectedZone] = useState("");
  const [selectedRestaurant, setSelectedRestaurant] = useState("");
  const [selectedRestaurantLocation, setSelectedRestaurantLocation] = useState(
    null
  );

  useEffect(() => {
    Axios.get("http://localhost:3001/restaurants").then((res) => {
      setRestaurants(res.data);
    });
  }, []);

  const handleCitySelect = (event) => {
    setSelectedCity(event.target.value);
    setSelectedZone("");
    setSelectedRestaurant("");
    setSelectedRestaurantLocation(null);
  };

  const handleZoneSelect = (event) => {
    setSelectedZone(event.target.value);
    setSelectedRestaurant("");
    setSelectedRestaurantLocation(null);
  };

  const handleRestaurantSelect = (event) => {
    const restaurant = restaurants.find(
      (r) => r.id === parseInt(event.target.value)
    );
    setSelectedRestaurant(event.target.value);
    setSelectedRestaurantLocation({
      lat: restaurant.latitude,
      lng: restaurant.longitude,
    });
  };

  useEffect(() => {
    if (selectedCity && selectedZone) {
      const startIndex = (selectedZone - 1) * 20;
      const endIndex = selectedZone * 20;
      Axios.get(`http://localhost:3001/restaurants/${selectedCity}`).then(
        (res) => {
          setRestaurants(res.data.slice(startIndex, endIndex));
        }
      );
    }
  }, [selectedCity, selectedZone]);

  return (
    <>
      <Header />
      <head>
  <script src="https://maps.googleapis.com/maps/api/js?key=YOUR_API_KEY"></script>
</head>

      <select value={selectedCity}
onChange={handleCitySelect}
>
<option value="">Select a city</option>
<option value="Casablanca">Casablanca</option>
<option value="Tanger">Tanger</option>
<option value="El Jadida">El jadida</option>
{/* add more cities as needed */}
</select>

<select
     value={selectedZone}
     onChange={handleZoneSelect}
   >
<option value="">Select a zone</option>
<option value="1">Zone 1</option>
<option value="2">Zone 2</option>
<option value="3">Zone 3</option>
<option value="4">Zone 4</option>
</select>
<select
     value={selectedRestaurant}
     onChange={handleRestaurantSelect}
   >
<option value="">Select a restaurant</option>
{restaurants.map((restaurant) => (
<option value={restaurant.id} key={restaurant.id}>
{restaurant.title}
</option>
))}
</select>
<GoogleMap
mapContainerStyle={mapContainerStyle}
zoom={15}
center={selectedRestaurantLocation || center}
>
{selectedRestaurantLocation && (
<Marker position={selectedRestaurantLocation}>
<InfoWindow>
<div>
<h3>{restaurants.find(r => r.id === parseInt(selectedRestaurant))?.title}</h3>
<p>{restaurants.find(r => r.id === parseInt(selectedRestaurant))?.address}</p>
</div>
</InfoWindow>
</Marker>
)}
</GoogleMap>
<Footer />
</>
);
}
